const {parseTemplate, filterAndSort, sanitize} = require('../gtm-custom-template-parser');
const mocks = require('../__mocks__/helpers.mocks');

describe('Test gtm-custom-template-parser.js', () => {
  test('Should return expected parsed template with a valid input', () => {
    const expected = {
      info: {
        displayName: 'Yandex Metrica',
        description: 'Yandex Metrica Custom Template',
        securityGroups: [],
        id: 'cvt_temp_public_id',
        type: 'TAG',
        version: 1,
        brand: {
          thumbnail: 'data:image/jpeg;base64,',
          displayName: 'Custom Template',
          id: 'brand_dummy'
        },
        containerContexts: [ 'WEB' ]
      },
      parameters: [], // Truncate
      permissions: [], // Truncate
      notes: 'Created on 30/5/2019 13:14:07',
      logo: 'data:image/jpeg;base64,',
      contexts: 'WEB',
      displayName: 'Yandex Metrica',
      description: 'Yandex Metrica Custom Template',
      type: 'Tag',
      added_date: '05 Jun 2019',
      updated_date: '05 Jun 2019'
    };
    const result = parseTemplate(mocks.validTemplate);
    expect(result.info).toMatchObject(expected.info);
    expect(result).toHaveProperty('parameters');
    expect(result).toHaveProperty('permissions');
    expect(result).toHaveProperty('notes', expected.notes);
    expect(result).toHaveProperty('logo', expected.logo);
    expect(result).toHaveProperty('contexts', expected.contexts);
    expect(result).toHaveProperty('displayName', expected.displayName);
    expect(result).toHaveProperty('description', expected.description);
    expect(result).toHaveProperty('type', expected.type);
    expect(result).toHaveProperty('parsed_added_date', expected.added_date);
    expect(result).toHaveProperty('parsed_updated_date', expected.updated_date);
  });

  test('Should work without parameters present', () => {
    const result = parseTemplate(mocks.validTemplateNoPermissions);
    expect(result.permissions).toMatchObject({});
  });

  test('Should use default logo if no thumbnail provided', () => {
    const expected = 'data:image/png;base64,';
    const result = parseTemplate(mocks.validTemplateNoLogo);
    expect(result).toHaveProperty('logo', expected);
  });

  test('Should sanitize invalid filter options', () => {
    const filterOptions = {
      categories: ['abc'],
      templateTypes: ['abc'],
      sort: ['abc']
    };
    const expected = {
      categories: [],
      templateTypes: [],
      sort: [],
      query: ['all']
    };

    const result = sanitize(filterOptions);
    expect(result).toMatchObject(expected);
  });

  test('Should not sanitize valid filter options', () => {
    const filterOptions = {
      categories: ['analytics', 'pixel'],
      templateTypes: ['tag'],
      sort: ['views'],
      query: ['query']
    };
    const expected = {
      categories: ['analytics', 'pixel'],
      templateTypes: ['tag'],
      sort: ['views'],
      query: ['query']
    };

    const result = sanitize(filterOptions);
    expect(result).toMatchObject(expected);
  });

  test('Should filter and sort different options correctly', () => {
    const parsedTemplates = [{
      category: '1',
      type: 'Tag',
      views: 1,
      downloads: 1,
      added_date: new Date(2019, 1, 1),
      updated_date: new Date(2019, 2, 2)
    },{
      category: '2',
      type: 'Variable',
      views: 2,
      downloads: 2,
      added_date: new Date(2019, 3, 3),
      updated_date: new Date(2019, 4, 4)
    }];

    // First test
    const filterOptions = {
      categories: ['1'],
      templateTypes: ['tag'],
      sort: ['views']
    };
    let [result] = filterAndSort(parsedTemplates, filterOptions);
    expect(result).toMatchObject(parsedTemplates[0]);

    // Second test
    filterOptions.categories = ['all'];
    filterOptions.templateTypes = ['all'];
    result = filterAndSort(parsedTemplates, filterOptions);
    expect(result).toMatchObject([parsedTemplates[1], parsedTemplates[0]]);

    filterOptions.categories = ['1'];
    [result] = filterAndSort(parsedTemplates, filterOptions);
    expect(result).toMatchObject(parsedTemplates[0]);

    filterOptions.categories = ['all'];
    filterOptions.templateTypes = ['variable'];
    [result] = filterAndSort(parsedTemplates, filterOptions);
    expect(result).toMatchObject(parsedTemplates[1]);

    // Third test
    filterOptions.categories = ['all'];
    filterOptions.templateTypes = ['all'];
    filterOptions.sort = ['downloads'];
    result = filterAndSort(parsedTemplates, filterOptions);
    expect(result).toMatchObject([parsedTemplates[1], parsedTemplates[0]]);

    // Fourth test
    filterOptions.sort = ['updated_date'];
    result = filterAndSort(parsedTemplates, filterOptions);
    expect(result).toMatchObject([parsedTemplates[1], parsedTemplates[0]]);

    // Fifth test
    filterOptions.sort = ['added_date'];
    result = filterAndSort(parsedTemplates, filterOptions);
    expect(result).toMatchObject([parsedTemplates[1], parsedTemplates[0]]);

  });

});
